All is fair in love and weddings!


Free mini vibe with purchase!

Best girlfriends come together to share a special moment; a wedding day! But before the bride can walk down the aisle, competing maids of honor Jesse Jane and Kayden Kross square off in a set of time honored traditions. A feisty fitting that features a horny back room fling , a wild bachelorette party where the male strippers aren't safe from the overheated honeys and a bridal shower that ends with the girls in jail! Award winning director Robby D. showcases Digital Playground contract superstars Jesse Jane, Kayden Kross, and Stoya as the beautiful bridesmaids. With 7 steamy sex scenes that include naughty girls Brooklyn Lee, Vicki Chase and Alyssa Branch as the bride. Bridesmaids will excite you with fun, passion, and desire!

